(315, 'Плетко Елена', 1, NULL, 144, 53, 43, 10.8, NULL, 2.74, 89.5, 5.8, 22.11, 2.11, 1510613913, 'Подозрение на почечную недостаточность 1 (слабой) степени ввиду того, что креатинин равен 144, в то время как у пожилых животных в норме креатинин не должен достигать 120. К тому же увеличено содержание белка.\r\nДля подтверждения диагноза необходимо УЗИ почек.\r\n\r\nУвеличение АСТ может говорить о разрушении клеток печени или миокарда. Учитывая, что остальные печеночные показатели в норме (АЛТ, О.билирубин, Щелочная фосфатаза, ГГТ), можно сделать вывод о повреждении именно миокарда.\r\nУвеличение АСТ незначительное, именно поэтому точно сказать без дополнительных методов диагностики нельзя.\r\n', 'Клавдий', NULL, 10, 1.11, NULL, NULL, NULL),
