INSERT INTO `news` (`id`, `title`, `news_discriprion`, `text_html`, `image`, `created_at`, `updated_at`) VALUES
(4, 'УЗИ-диагностика в ветеринарии', 'УЗИ-диагностика широко используется нашими ветеринарными специалистами при постановке диагноза. Этот метод представляет собой диагностирование состояния внутренних органов с помощью ультразвуковых волн.', '<p>УЗИ-диагностика применяется в следующих случаях:</p><ul><li>Для оценки состояния и работы всех систем и органов</li><li>Для обнаружения камней в почках, мочевом и желчном пузырях</li><li>Для диагностики беременности</li><li>Обследование брюшной полости на наличие опухолей</li><li>Контроль за ходом лечения</li><li>Профилактические осмотры </li><li>Профилактика заболеваний пожилых животных</li><li>Предоперационный осмотр</li></ul><p><em>Метод основывается на свойстве аппарата создавать волны, которые эхом отражаются от внутренних органов. Иными словами УЗИ собаке или кошке - это эхография. Эхо, которое получено от здоровых органов, существенно отличается от волн, идущих от пораженного недугом. Возможность подтвердить диагноз, выявить очаги поражения позволяют назначать эффективные способы терапии.</em><br></p><p><em>В наших клиниках имеются современные УЗИ-аппараты, позволяющие отлично просканировать интересующий нас орган, что позволяет четко поставить диагноз нашим любимцам.</em></p><p><em></em></p><p><img src=\"https://pp.userapi.com/c837323/v837323309/72440/lVw9uEzmmxA.jpg\"></p><p>Спешите записаться! Тел.:8029-891-92-93; 52-03-78,46-33-33</p>', '/storage/img/news/1509556526-узи.jpg', 1509539463, 1509645550),
(5, 'Все, что Вы хотели знать о гирудотерапии животных', 'Гирудотерапия известна человечеству еще за 200 лет до нашей эры. С их помощью врачи Египта, Китая, Индии лечили и продолжают лечить многие заболевания.\r\nВ настоящее время гирудотерапия широко применяется и в ветеринарии при многих заболеваниях.', '<p>Название происходит от слова Hirudina, что означает \"пиявка\".</p><p>Историки утверждают, что изображения сцен применения пиявок можно обнаружить среди фресок гробниц египетских фараонов. Порошок из высушенных и толченых пиявок использовали китайские лекари. Знаменитый таджикский ученый Авиценна, в своем знаменитом «Каноне врачебной науки» прочего упомянул о целебной силе пиявок, помогающих при туберкулезе, истерии и эпилепсии, сотрясениях мозга, а также болезнях суставов, печени и почек. </p><p>Но перейдем к современным реалиям. <span style=\"background-color: rgb(255, 230, 148);\"></span></p><h3><span>На данный момент с помощью пиявок лечат следующие патологии:</span></h3><ul><li>Заболевания репродуктивных органов</li><li>Сердечная недостаточность, гипертензия и прочие заболевания сердечно-сосудистой системы</li><li>Кожные заболевания</li><li>Воспалительные процессы</li><li>Раны и многое другое.</li></ul><h3>Что именно позволяет поддержать животное при данных патологиях? Секрет прост: слюна пиявок обладает следующими свойствами:</h3><p> Противотромботическое (блокирует образование тромба)<br> Тромболитическое (растворяет сформировавшийся тромб)<br> Гипотензивное (нормотензивное) – стабилизирует артериальное и венозное давление<br> Антиатерогенное (снижает уровень холестерина)<br> Репаративное воздействие на повреждённую стенку сосуда<br> Антигипоксическое (улучшает обмен веществ при кислородном голодании)<br> Иммуностимулирующее (местное и общее)<br> Аналгезирующее (обезболивающее) противовоспалительное<br> Противомикробное<br> Регенеративное (восстанавливающее)<br> Нейротрофическое</p><p><strong></strong></p><h4>Не смотря на обширное применение гирудотерапии, имеются и противопоказания к данному методу лечения:</h4><ul><li>анемия</li><li>гипотония (пониженное давление)</li><li>отравления различной этиологии</li><li>онкологические заболевания</li><li>инфекции</li></ul><p><strong><em>Перед тем, как поставить пивку, животное не следует мыть шампунем или наносить на него сильнопахну</em>щие вещества.</strong></p><h3>   Назначать пиявки должен только ветеринарный доктор, который осмотрел животное и провел необходимые диагностические мероприятия. Ведь всегда важно помнить, что впереди лечения - ДИАГНОСТИКА, и только после подтверждения диагноза можно принимать решения о гирудотерапии.</h3>', '/storage/img/news/1509559124-16c8a3490aaa3eb5927dab34c17e0cd0.jpg', 1509558578, 1509559124),
(9, 'Еще одна победа !', '              На этой неделе в нашей ветеринарной лечебнице в городе Новополоцке была успешно произведена полостная операция по удалению матки у ягдтерьера Эльзы...                                                                         ', '<h1>Позади переживания, тяжкий груз принятия ответственного решения. Впереди - жизнь. </h1><h1></h1><h3></h3><h2>О том, с какими трудностями пришлось столкнуться владельцам животного и ветеринарным врачам читайте далее… </h2><p>В семью Эльза попала, будучи бездомной взрослой собакой, несколько лет назад. За любовь и заботу все эти годы она платит верностью и преданностью. Хотя на приеме у доктора не прочь показать свой нрав. История ее болезни началась более месяца назад, когда во время визита в лечебницу по причине недомогания был поставлен диагноз - пиометра (гнойное воспаление матки). Далеко не молодой возраст Эльзы, повышенное артериальное давление и интоксикация, характерная для данного заболевания, исключали, показанное в таких случаях, проведение операции.</p><p><img src=\"/storage/img/news/3/cb2a75a623-img-7c310130f04ed622e19f26ede7fc080d-v1.jpg\" alt=\"cb2a75a623-img-7c310130f04ed622e19f26ede7fc080d-v1\"><br></p><p><br></p><p>После продолжительных бесед с владельцами было принято решение о консервативном лечении. Капельницы, инъекции и регулярный контроль состояния животного, в том числе с помощью УЗИ-диагностики, дали положительный эффект. Нужно отдать должное хозяевам Эльзы - при очередном ухудшении самочувствия собаки ими было принято решение об оперативном вмешательстве. Операцию проводили Чертопалов Геннадий Петрович ( анестезиологическое и реанимационное обеспечение) и Батурин Артем Викторович (хирургическая часть). Во время операции в режиме реального времени осуществлялся мониторинг артериального давления, пульса и дыхания. Для операции мы использовали наркоз, обеспечивающий полное обезболивание. Благодаря слаженной работе нашего коллектива (в одной команде врачи работают более десяти лет) операция была проведена в течение 25 минут. Основное время пребывания животного в клинике было потрачено на восстановление основных функций организма и профилактику шока. Пациент вышел из клиники «на своих ногах». Только не значительный шов в области «бикини» напоминал о проведенной операции.<o:p style=\"background-color: initial; font-family: inherit; font-size: 18px; line-height: 1.3;\"></o:p> </p><p> У владельцев Эльзы не было возможности в молодом возрасте стерилизовать собаку, что полностью могло бы исключить возникновение пиометры. Успех данной операции был обусловлен абсолютным доверием между владельцами пациента и коллективом врачей. После операции мы контролируем состояние животного круглосуточно и всегда готовы прийти на помощь в любое время дня и ночи.</p><h4></h4><p><br></p><h1>Здоровья тебе Эльза! Пусть твоя шерсть переливается всеми цветами радуги в лучах скупого осеннего солнца!</h1>', '/storage/img/news/1510052973-281882.jpg', 1510051914, 1510053267),
(10, 'Приятные и не очень вопросы ветеринару по стерилизации', 'Чувствуют ли кошки боль во время стерилизации, опасна ли она для жизни, делают ли ветеринары операции своим кошкам?  \r\n\r\n\r\nНа вопросы жителей Полоцка и Новополоцка отвечает ветеринарный врач Чертопалов Геннадий Петрович.\r\n', '<ul><li><strong>. В каких случаях нужно стерилизовать кошку?</strong></li></ul> <p>Если Вы не заводчик породистых кошек – всегда.</p> <ul><li><strong>2. Для чего нужна стерилизация?</strong></li></ul> <p>Стерилизация больше нужна не Вам и не Вашим соседям, когда кошка кричит по ночам, беспокойно себя ведет и оставляет метки на вещах и мебели, а прежде всего для самого животного, поскольку в природе у каждой самки во время течки должен быть «секс», а после этого – беременность. Поскольку ни первого, ни второго у кошки, сидящей в квартире нет, то в организме происходят изменения приводящие к воспалению матки и заболеваниям молочной железы.</p> <ul><li><strong>3. Так что, кошку отпускать на улицу?</strong></li></ul> <p>Поскольку вся территория наших городов поделена между котами, то всегда найдется тот, кто сможет ее оплодотворить. Но вместе со своим генетическим материалом, «уличный казанова» передаст Вашей любимице не только блох, но и болезни, которыми заражается и человек (ЛИШАЙ, ХЛАМИДИОЗ и др.)</p> <ul><li><strong>4. Вместо того, чтобы отдавать свою любимицу под нож, не лучше ли накормить ее капельками или таблеточками от «хочунчиков»?</strong></li></ul> <p> В ветеринарных аптеках продаются средства для угнетения половой охоты у кошек. «Стоп интим», «Контрасекс» и др. Они бывают в виде таблеток или в жидком виде. Имеется так же инъекционная форма - «Ковинан». Эти препараты лучше использовать тогда, когда операция противопоказана по медицинским соображениям, например - больное сердце, или когда владелец не готов предоставить любимицу на операцию – в качестве временной меры. Но нужно иметь в виду, что действующим веществом этих лекарств является гормон беременности, который вызывает в половой системе кошки изменения, приводящие к заболеванию - пиометра.</p> <ul><li><strong>5. Неужели нет других, более безопасных лекарств для угнетения половой охоты?</strong></li></ul> <p> Да, есть препарат, изготовленный на основе лекарственных растений «Кот Баюн», но он лишь незначительно успокаивает животное.</p> <ul><li><strong>6. В чем различие между стерилизацией и кастрацией?</strong></li></ul> <p> Многие люди думают, что кастрация – это то, чему подвергают котов или кобелей, а стерилизация проводится у кошек и сук. Это не совсем так. Стерилизация – это лишение животного способности к размножению, при этом половая охота и течка сохраняются. Кошки и коты в таком случае вступают в половой контакт, но потомство при этом не получается. По другому это называется «перевязывание труб». Кошка как вела себя беспокойно, точно так же будет вести себя после операции. А вот кастрация – это удаление половых желез. После такой операции у животного уходит потребность в размножении. Слово «стерилизация» мягче ложится на слух.</p><p><strong><em>НЕПРИЯТНЫЕ ДЛЯ ВЕТЕРИНАРОВ ВОПРОСЫ.</em></strong></p> <ul><li><strong>7. Опасна ли для жизни стерилизация-кастрация?</strong></li></ul> <p> Да, опасна.</p> <ul><li><strong>8.То-есть, Вы предлагаете делать операцию, заведомо опасную для жизни?</strong></li></ul> <p> Любая полостная операция у животного, к тому же проводимая под наркозом представляет угрозу для жизни пациента. Какой бы наркоз не использовался, каким бы опытным ни был врач, риск есть всегда. И если ветеринарный врач говорит о том, что в его практике не было летальных случаев – он говорит неправду. Прочтите отзывы о любой ветеринарной клинике в интернете.</p> <ul><li><strong>9. А у Вас были такие случаи?</strong></li></ul> <p> Да, были.</p> <ul><li><strong>10. Как владельцы реагируют на случившееся?</strong></li></ul> <p> Практически для всех эта потеря сравнима с потерей близкого члена семьи. И еще тяжелее осознавать, что этого могло не случиться, не принеси кошку на операцию.</p> <ul><li><strong>11. Не стерилизовать – плохо, стерилизовать – опасно. Что делать?</strong></li></ul> <p> Принимает решение сам владелец. Выбирает клинику или ветеринарного врача тоже сам. При этом люди руководствуются личными симпатиями, советами друзей и коллег, черпают информацию из интернета. Некоторые сами приходят в ветклинику или звонят нам и задают эти вопросы. Мы честно рассказываем.</p> <ul><li><strong>12. Как уменьшить риск при стерилизации животного?</strong></li></ul> <p> Во-первых, владельцу нужно самому быть уверенным в благоприятном исходе операции. Во-вторых, кошка должна быть обработана против глистов, ей должны быть сделаны прививки. За 12 часов до операции животное не кормят. Это обезопасит ее от попадания рвотных масс в дыхательные пути. Ветеринарный врач осмотрит кошку перед наркозом. В наших клиниках есть возможность произвести ЭКГ и УЗИ исследование животного. Перед операцией мы можем провести исследование крови животного. На случай остановки дыхания мы интубируем животное (вставляем в трахею трубку для возможности искусственной вентиляции легких), а современный прибор контролирует пульс и давление у пациента. </p> <ul><li><strong>13. Кошка чувствует боль во время операции ?</strong></li></ul> <p> Нет, не чувствует. У нас есть разрешение, выданное Министерством здравоохранения и МВД на использование медицинского наркоза, точно такой же используется для людей.</p> <ul><li><strong>14. Как скоро кошки «отходят» от операции?</strong></li></ul> <p>У нас опытные ветеринарные врачи. Операцию они стараются провести в наиболее короткий промежуток времени. Соответственно для поддержания наркоза требуется меньшее его количество. И как следствие кошка уже на следующий день начинает принимать пищу – верный признак улучшающегося самочуствия.</p> <ul><li><strong>15. Как ухаживать за кошкой?</strong></li></ul> <p>Вас не отпустят домой с животным, находящимся под наркозом. Ветеринар постарается убедить владельца побыть в клинике до полного выхода из этого состояния. По прибытии домой поместите животное в самую теплую комнату или на грелку. Обеспечьте доступ воды. Но самое главное нужно наблюдать за кошкой. Если у Вас появились сомнения в самочувствии своей любимицы – будьте готовы позвонить нам, привезти кошку вновь, по возможности мы можем к Вам выехать.</p> <ul><li><strong>16. Когда нужно снимать швы?</strong></li></ul> <p> Швы снимать не нужно. Мы накладываем рассасывающиеся швы. </p> <ul><li><strong>17. Кто из врачей Вашей клиники проводит стерилизацию кошек?</strong></li></ul> <p>В Новополоцке: </p><p>- Чертопалов Геннадий Петрович</p><p>- Батурин Артем Викторович</p><p>- Осмаковская Анна Геннадьевна</p><p>В Полоцке:</p><p>- Чертопалов Геннадий Петрович</p><p>- Герасимов Виталий Александрович</p><p> - Карпик Дмитрий Павлович</p><p><strong> 18. Сколько стоит стерилизация кошки?</strong><br></p><p> Стоимость операции 40 рублей. Для бездомных животных цена данной операции составляет 25 рублей.</p> <ul><li><strong>19. А в чем разница?</strong></li></ul> <p> Разницы нет никакой. Тот же наркоз, те же врачи и точно такие же расходные материалы.</p> <ul><li><strong>19.Как можно произвести запись по поводу стерилизации кошки?</strong></li></ul> <p>Запись на стерилизацию производится по телефону в Новополоцке 52 03 78</p><p>В Полоцке 46 33 33, 74 78 79 или по мобильной связи :</p><p>8 029 891 92 93, 8 029 625 22 49</p> <ul><li><strong>20.А Ваши животные стерилизованы? </strong></li></ul> <p> Да, у меня в доме живет кошка Клепа и кот Кузя. Они не породистые. Кузю я подобрал на Калининском перекрестке - у него едва были открыты глаза. Кошка Клеопатра крестьянского происхождения - принесли с фермы. Животные прооперированы лично мной. И похоже, что они на меня не в обиде за это/</p>', '/storage/img/news/1510582744-IMG_20171112_170859.jpg', 1510582744, 1510688144),
(11, 'Бывает же такое', 'Этой напуганной овчарке и не менее напуганным хозяевам животного повезло – ей своевременно оказали помощь в ветклинике на Ленина, 14. Что же случилось с языком животного… ', '<p><img src=\"/storage/img/news/3/3fe937c643-kvftgf8xcri.jpg\" width=\"201\" height=\"150\" style=\"width: 201px; height: 150px;\">Немецкая овчарка была доставлена в ветлечебницу с чрезмерным отеком языка. Бедняжка не могла понять, почему язык не помещается в пасти. Такое случается, когда животные подвергаются нападению ядовитых насекомых или змеи, но на улице ноябрь. Проведя клинический осмотр, доктора установили, что причина  - поедание хрящей говяжьей трахеи. Так получилось, что плохо пережеванный кольцеобразный хрящ пережал корень языка. Животное спасено. Вывод - при скармливании говяжьих субпродуктов собакам, старайтесь их измельчать на как можно меньшие кусочки.   </p>', '/storage/img/news/1510946487-0BQk33oNDU4.jpg', 1510946487, 1510946487),
(12, 'Маленькое сердце крольчишки продолжает стучать!', 'В городе, котором живет крольчишка Чеха, нет возможности сделать операцию кролику с надежным обезболиванием и без угнетения работы сердца …', '<p style=\"text-align: justify;\">   В городе, котором живет крольчишка Чеха, нет возможности сделать операцию по удалению матки кролику с надежным обезболиванием и без угнетения работы сердца. Поэтому ее короткоухие члены семьи привезли к нам в лечебницу на Ленина, 14. Не смотря на то, что операция проведена быстро – крольчишка и ее хозяин еще долго пребывали в лечебнице на грелке - пока мы не убедились в благоприятном исходе оперативного вмешательства. На следующий день ветеринарный врач Чертопалов Геннадий Петрович поинтересовался здоровьем своего маленького пациента. На что ему ответили, что Чеха жива, здорова и с аппетитом поедает свою трын-траву. Здоровья тебе, ушастик!</p><p><img src=\"/storage/img/news/3/575ca386eb-.png\" style=\"line-height: 1.6em; width: 973px; height: 730px; display: block; margin: auto;\" width=\"973\" height=\"730\" alt=\"\"></p>', '/storage/img/news/1511209509-575ca386eb-.png', 1511208841, 1511209714),
(13, 'График работы наших ветеринарных клиник в новогодние праздники!', 'Режим работы в новогодние праздники.', '<p><img src=\"/storage/img/news/3/1ab8d48457-maxresdefault.jpg\"></p><p><img src=\"/storage/img/news/3/1451ddd9ee-273853855.jpg\"></p><p><img src=\"/storage/img/news/3/d68347b4ce-maxresdefault-1.jpg\"></p>', '/storage/img/news/1513967939-594.jpg', 1513967840, 1513967840),
(16, 'МЕДИАЛЬНЫЙ ВЫВИХ КОЛЕННОЙ ЧАШЕЧКИ СОБАК', 'Сегодня говорим о частом заболевании:\r\nМЕДИАЛЬНЫЙ ВЫВИХ КОЛЕННОЙ ЧАШЕЧКИ', '<h4>Как приятно смотреть на свою собаку, бегущую по заснеженному полю. Порой кажется - силы гравитации не подвластны этому безудержному, совершенному созданию и известно только Богу и Природе, чем же достигается эта слаженная работа мышц и скелета. Но жизнь заставляет и нас, ветеринаров, подправлять кирпичики в монументе Эволюции...<br></h4><p><b></b></p><p><img src=\"https://pimg.mycdn.me/getImage?disableStub=true&amp;type=VIDEO_S_720&amp;url=http%3A%2F%2Fi.ytimg.com%2Fvi%2FaGgLKmONtTQ%2F0.jpg&amp;signatureToken=LEghs7yiaWg4GDrNaOYfDw\"></p><p><b>Так выглядит колено бедняжки<br></b>Чаще к заболеванию предрасположены собаки мелких декоративных пород - шпицы, йоркширские терьеры, чи- хуа. Но в нашей практике были случаи у крупных пород. За исключением травм, недуг чаще носит наследственный характер и сопровождается нарушением работы тазовых конечностей, хромотой и болезненностью.</p><p><img src=\"http://animal-store.ru/img/2015/050205/5124831\"></p><p>Виновницей является маленькая косточка, каплеобразной формы- <b>коленная чашечка</b>, (мы видим ее на рисунке сверху под № 1 на своем месте, под № 2 и 3 она вывернута внутрь и наружу) которая отвечает за работу такого важного коленного сустава и должна находиться на своем рабочем месте – в желобе коленной чашки бедренной кости. Так вот, часто бывает, что этот желоб не достаточно выражен, и в процессе работы коленная чашка сходит в сторону- как поезд с рельс.</p><p><br></p><p><b>Так в норме должна бежать по желобу коленная чашечка вашей собаки…</b><span class=\"redactor-invisible-space\"></span></p><p><img src=\"/storage/img/news/3/fa176b8244-.png\"></p><p><br></p><b>а так не должна !</b><p><b></b><span class=\"redactor-invisible-space\"><img src=\"/storage/img/news/3/e41ba0b627-2.png\"><span class=\"redactor-invisible-space\"></span><br></span></p><p><span class=\"redactor-invisible-space\"><span class=\"redactor-invisible-space\">От степени тяжести болезни зависит и характер лечения. Часто консервативное лечение не дает эффекта, и мы прибегаем к операции.<span class=\"redactor-invisible-space\"><br></span></span></span></p><p><span class=\"redactor-invisible-space\">Конечно же доктор не будет сходу отправлять пациента на операционный стол - каждый случай индивидуален.<span class=\"redactor-invisible-space\"><br></span></span></p><p><span class=\"redactor-invisible-space\"><span class=\"redactor-invisible-space\"></span></span></p><p><b><em>Ветеринарные врачи наших клиник успешно проводят такие операции и по закону парных случаев год был богат на подобного рода операции. Несколько шпицев, йорков и даже охотничья лайка покинули стены наших клиник с «отремонтированными» коленными суставами.<br></em></b><b><em>Хотите узнать в чем успех операций? Ответим!</em></b></p><h2>1. Опыт и постоянное совершенствование наших ведущих хирургов</h2><p><b><em></em></b></p><p><img src=\"https://pp.userapi.com/c841423/v841423875/42e79/zBh_ZtJdJ2A.jpg\"></p><p><b><strong><em>Ведущие хирурги Виталий Герасимов и Артем Батурин - </em></strong></b><b><strong><em>участники Всебелорусского Ветеринарного конгресса </em></strong></b></p><h2></h2><h2 style=\"font-family: Arial, Helvetica, Verdana, Tahoma, sans-serif;\">2. Опыт и постоянное совершенствование наших ветеринарных анестезиологов-реаниматологов.</h2><p><b></b></p><p><img src=\"https://pp.userapi.com/c841434/v841434875/48803/lRS3vDzufZo.jpg\"></p><p><b><em>Наш директор Геннадий Чертопалов и ведущий ветеринарный врач Анна Осмаковская -  участники Всебелорусского Ветеринарного конгресса </em></b><em></em><br></p><h2>3. Отличный наркоз для Вашего питомца, при котором боль чувствует только врач!</h2><h2>В наших клиниках есть лицензия для использования животным человеческого наркоза!</h2><p><img src=\"/storage/img/news/3/5dc2e1d185-.png\"></p><p><img src=\"/storage/img/news/3/0b29fc909d-.png\"></p><p><b>Ветеринарный врач - хирург Виталий Герасимов возвращает шпица Зету хозяину после очередной успешной операции на коленных суставах.<o:p></o:p></b><b>Если Ваша собака хромает, наши опытные врачи постараются найти причину хромоты. Возможно у Вашего питомца вывих коленной чашечки.<o:p></o:p></b><span class=\"redactor-invisible-space\"></span></p><p><img src=\"/storage/img/news/3/fb5c588e6a-.png\"></p><b>Если Ваша собака хромает, наши опытные врачи постараются найти причину хромоты. Возможно у Вашего питомца вывих коленной чашечки.<o:p></o:p></b><br>', '/storage/img/news/1514030496-chain.jpg', 1514030090, 1514030090),
(17, 'Поздравление с Новыми Годом от нашего коллектива!', '    Дорогие друзья!\r\n    Коллектив наших клиник поздравляет Вас с наступающим Новым годом и Рождеством!\r\n    Желаем Вам всем крепкого здоровья и              \r\n    исполнения заветных желаний!\r\n', '<h2>Дорогие Друзья! Наш дружный коллектив поздравляет всех вас и ваших любимцев с Рождеством и Новым годом! Специально для Вас - наши персональные поздравления!</h2><p><img src=\"/storage/img/news/3/9d884c0c8a-.png\"></p><p>Таким длинным стихотворением нас порадовали Алла Анатольевна и Геннадий Петрович Чертопаловы - директора наших клиник. К тому же, Геннадий Петрович - наш главный специалист с ветеринарным стажем более 20 лет. Именно благодаря стараниям этих двух людей у Вас есть возможность получить качественную ветеринарную помощь Вашим питомцам!</p><p>А теперь перейдем к поздравлению от нашего доктора Артема Викторовича Батурина, известным в Новополоцке как отличный хирург, который уже несколько лет  с успехом помогает и кошкам, и собакам, и птицам, и мелким грызунам!</p><p><img src=\"/storage/img/news/3/1a3813cb14-.png\"></p><p><br></p><p>Поздравление от Виталия Александровича Герасимова - опытного хирурга и анестезиолога, активно спасающего питомцев в г. Полоцк.</p><p><img src=\"/storage/img/news/3/e7b3881ca5-.jpg\"></p><p><br></p><p>Дмитрий Павлович Карпик со своей семьей также поздравляют Вас и Ваших любимцев с Новым годом позитивным стихотворением!<img src=\"/storage/img/news/3/03dcd725fe-.jpg\"></p><p><br></p><p><br></p><p>Новогоднее поздравление от Красиковой Татьяны!</p><p><img src=\"/storage/img/news/3/5d1cfdfa9c-.jpg\"></p><p><br></p><p><br></p><p>Ткачев Виктор Владимирович совсем недавно в нашем коллективе, но уже придумал для своих клиентов прекрасное стихотворение!</p><p><img src=\"/storage/img/news/3/51c151aa30-.jpg\"></p><p><br></p><p>Осмаковская Анна Геннадьевна также присоединяется к поздравлением с помощью небольшого четверостишья.<img src=\"/storage/img/news/3/b476057337-.jpg\"></p><p><br></p><p>И завершают наш сегодняшний парад поздравлений прекрасные слова от очаровательных дам, которые помогают выбрать Вашим питомцам самое лучшее по адресу ул. Молодежная 32, г. Новополоцк.</p><p><img src=\"/storage/img/news/3/18ffb9c983-.jpg\">Поздравление от Карины Андрушенок и Ярославы Гребенченко!<br></p><p><br></p><p>Дорогие друзья! Еще раз с наступающими праздниками! Пусть Вашим питомцам ничто не омрачает жизнь, а походы к ветеринарному врачу будут носить лишь профилактический характер!<img src=\"/storage/img/news/3/97ae0b0c40-.jpg\"><span class=\"redactor-invisible-space\"></span></p>', '/storage/img/news/1514491683-so.jpg', 1514491683, 1514491683);
